import logo from './logo.svg';
import './App.css';
import data from './data';
import Display from './Display';

function App() {

  console.log(data);
  function printConsole(){
    data.forEach(function(item) {
      console.log(item.name, item.firstName);
    })
  };
  printConsole();
  return (
    <div className="App">
      <div>
        <Display name={data[0].name} firstName={data[0].firstName}/>
      </div>
    </div>
  );
}

export default App;
